  false,\n\t\"url\": null,\n\t\"notes\": \"The Cityu2019s certification programs,
  including the Minority and Women-owned Business Enterprise (M/WBE) Program, the
  Emerging Business Enterprise (EBE) Program and the Locally-based Business Enterprise
  (LBE) Program certify, promote, and foster the growth of the Cityu2019s minority
  and women-owned businesses and eligible small construction and construction-related
  businesses. Companies that become certified obtain greater access to and information
  about contracting opportunities, receive technical assistance to better compete
  for those opportunities, and benefit from inclusion in the Cityu2019s Online Directory
  of Certified Firms. This list contains detailed information on certified companies,
  including a brief description of their work history, contact information, and detailed
  information about what the companies sell. This data is up to date as of the date
  reflected in the \"About\" tab of this dataset.\",\n\t\"license_title\": \"License
